import {Switch, BrowserRouter as Router, Route} from "react-router-dom/cjs/react-router-dom.min";
import "./App.scss";
import Home from "./pages/home/Home";
import Watch from "./pages/watch/Watch";

const App = () => {
    return (
        <Router>
            <Switch>
                <Route exact path="/">
                    <Home />
                </Route>
                <Route path="/movies">
                    <Home type="movies" />
                </Route>
                <Route path="/series">
                    <Home type="series" />
                </Route>
                <Route path="/watch">
                    <Watch />
                </Route>
            </Switch>
        </Router>
    );
};
export default App;
